#define dataHi PORTB |= _BV(4)
#define dataLo PORTB &= ~_BV(4)
#define shiftClock PORTB |= _BV(5);PORTB &= ~_BV(5);
#define storeClock PORTB |= _BV(3);PORTB &= ~_BV(3);

void send(uint8_t data)
{
  for(uint8_t i=0;i<8;i++)
  {
    if(data & 1){
      dataHi;
    }
    else{
      dataLo;
    }//set data
    data = data >> 1;
    shiftClock;
  }
  storeClock;
}
void send4(uint8_t data)
{
  for(uint8_t i=0;i<4;i++)
  {
    if(data & 1){
      dataHi;
    }
    else{
      dataLo;
    }//set data
    data = data >> 1;
    shiftClock;
  }
  storeClock;
}

