#define PORT6O PORTD
#define DDR6O DDRD

#define PORT3O PORTB
#define DDR3O DDRB

#define PIN3I PINC
#define DDR3I DDRC

#define BP1U _BV(2)
#define BP1D _BV(3)
#define BP1A _BV(0)
#define BP1B _BV(0)

#define BP2U _BV(4)
#define BP2D _BV(5)
#define BP2A _BV(1)
#define BP2B _BV(1)

#define BP3U _BV(6)
#define BP3D _BV(7)
#define BP3A _BV(2)
#define BP3B _BV(2)


//
uint8_t PWR_ON6O[] = {
  BP1U + BP2D, // 1-2 a
  BP1U + BP3D, // 1-3 b
  BP2U + BP3D, // 2-3 c
  BP2U + BP1D, // 2-1 d
  BP3U + BP1D, // 3-1 e
  BP3U + BP2D  // 3-2 f
};

uint8_t RECYCLE6O[] = {
  0 + BP2D, // 1-2 a
  0 + BP3D, // 1-3 b
  0 + BP3D, // 2-3 c
  0 + BP1D, // 2-1 d
  0 + BP1D, // 3-1 e
  0 + BP2D  // 3-2 f
};
uint8_t RECYCLE3O[] = {
  BP1B, // 1-2 a
  BP1B, // 1-3 b
  BP2B, // 2-3 c
  BP2B, // 2-1 d
  BP3B, // 3-1 e
  BP3B  // 3-2 f
};


uint8_t PWR_OFF6O[] = {
  0    + BP2D, // 1-2
  0    + BP3D, // 1-3
  0    + BP3D, // 2-3
  0    + BP1D, // 2-1
  0    + BP1D, // 3-1
  0    + BP2D  // 3-2
};

